let singleStockFormEl = document.querySelector("#single-stock-form")
let getNewsFormEl = document.querySelector("#news-form")
let dataListEl = document.createElement("datalist");
dataListEl.setAttribute("id","all-tickers");

function createDataList(arr) {
  for (let i =0; i < arr.length; i++) {
    let optionEl = document.createElement("option");
    optionEl.value = arr[i].symbol;
    optionEl.textContent = arr[i].name;
    dataListEl.appendChild(optionEl);
  }
  
  if(singleStockFormEl) {
    singleStockFormEl.appendChild(dataListEl); 
  }
  
  if(getNewsFormEl) {
    getNewsFormEl.appendChild(dataListEl);
  }
}

